import React from 'react';
import './ProductListingPage.css';

const products = [
  { id: 1, category: 'Air Purifying Plants', name: 'Snake Plant', price: 15 },
  { id: 2, category: 'Air Purifying Plants', name: 'Spider Plant', price: 12 },
  { id: 3, category: 'Air Purifying Plants', name: 'Peace Lily', price: 18 },
  { id: 4, category: 'Aromatic Fragrant Plants', name: 'Boston Fern', price: 20 },
  { id: 5, category: 'Aromatic Fragrant Plants', name: 'Rosemary', price: 15 },
  { id: 6, category: 'Aromatic Fragrant Plants', name: 'Aloe Vera', price: 22 },
];

const ProductListingPage = () => {
  const categories = Array.from(new Set(products.map(product => product.category)));

  return (
    <div className="product-listing-page">
      {categories.map(category => (
        <div key={category} className="product-category">
          <h2>{category}</h2>
          <div className="product-grid">
            {products
              .filter(product => product.category === category)
              .map(product => (
                <div key={product.id} className="product-card">
                  <img src={`path/to/images/${product.name.toLowerCase().replace(' ', '-')}.jpg`} alt={product.name} />
                  <h3>{product.name}</h3>
                  <p>${product.price}</p>
                  <a href="#" className="add-to-cart">Add to Cart</a>
                </div>
              ))}
          </div>
        </div>
      ))}
    </div>
  );
}

export default ProductListingPage;
